
from itertools import permutations

from numpy import true_divide
class Solution(object):
    def checkInclusion(self, s1, s2):
        """
        :type s1: str
        :type s2: str
        :rtype: bool
        """
        s1_hashmap = {}
        
        #Create a hashmap of s1 to figure out the permutations
        for i in s1:
            s1_hashmap[i] = 1+ s1_hashmap.get(i,0)

        #iterate through s2, by the size of s1
        for r in range(len(s2)):
            window_hashmap = {}
            window_length = len(s1)

            if r + window_length <= len(s2):
                for i in range(r, r+window_length):
                    window_hashmap[s2[i]] = 1 + window_hashmap.get(s2[i],0)
            
            print("s1_hashmap", s1_hashmap)
            print("window_hashmap", window_hashmap)
            print("---")
            if s1_hashmap == window_hashmap:
                return True
        
        
        return False

    def checkInclusion_optimized(self, s1, s2):

        if len(s1) > len(s2):
            return False
        
        s1Count, s2Count = [0] * 26, [0]*26

        for i in range(len(s1)):
            s1Count[ord(s1[i]) - ord('a')] +=1
            s2Count[ord(s2[i]) - ord('a')] +=1


        matches = 0

        for i in range(26):
            matches += (1 if s1Count[i] == s2Count[i] else 0)
        
        l =0
        for r in range(len(s1),len(s2)):
            if matches == 26:
                return True
            
            index = ord(s2[r]) - ord('a')
            s2Count[index] += 1
            if s1Count[index] == s2Count[index]:
                matches +=1
            elif s1Count[index] +1 == s2Count[index]:
                matches -=1
            
            index = ord(s2[l]) - ord('a')
            s2Count[index] -= 1
            if s1Count[index] == s2Count[index]:
                matches +=1
            elif s1Count[index] - 1 == s2Count[index]:
                matches -=1

            l+=1
        return matches == 26



